import { useEffect, useState } from 'react';
import axios from 'axios';
import React from 'react';

const API = async () => {
  try {
    const response = await axios.get('https://fakestoreapi.com/products');
    return { response: response.data };
  } 
  catch (error) {
    return { error };
  }
};

export default API;
